import styled from "styled-components";

export const HeaderContainer = styled.header`
    display: flex;
    justify-content: space-between;
    align-items: center;
    gap: 10%;
    padding: 0 15vw;
    height: 120px;
    width: 100vw;

    .imgLogo {
        width: 150px;
        height: 180px;
    }
`
